import "./Home.scss"
function Home() {

  const[show,setshow] = useState(true)
  
  const change = () =>{
    setshow(!show)
  }

  return (
    <div>
      <IoIosArrowDroprightCircle className='icon-arrow' onClick={change} />
      
      <nav className='navbar'>
        <lable>Home</lable>
        <lable>About</lable>
        <lable>Add Cart</lable>
        <lable>Login</lable>
        <lable>Register</lable>
      </nav>
      {/* <h1>This is my Home</h1>
